    [],nt"revision_timestamp": "2016-07-27T23:03:05.454096",nt"name": "1982-walrus-harvest-health-and-welfare-study-at-wales-alaska-progress-report",nt"isopen":
    false,nt"url": null,nt"notes": "The total documented retrieved harvest
    at Wales for the spring of 1982 was 119 walruses (Odobenus rosmarus), including
    43 adult males, 58 adult females, 15 adults of unknown sex, and 3 calves. The number
    of animals shot and lost was not determined. Lower canine teeth unaccompanied by
    soft tissues were obtained from 90 walruses, reproductive tracts with teeth from
    9 females, and stomachs with teeth were collected from 3 animals. The median age
    of 43 adult male walruses whose teeth were examined was 19 years. The median age
    of 58 adult females was 13 years. The number of man-hours spent per walrus retrieved
    was 8.32.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
